            "created": 1326383071000, 
            "description": "<p>To quote Arrested Development:\u00a0<a href=\"https://www.youtube.com/watch?v=tj7RlQdF25A\">\"Hasn't everything already been discovered already though? like Magellan... Cortez... NASA... \", \"well, yeah, they did a pretty good job\", \"it never hurts to double check\".\u00a0</a></p> <p>Some of our favorite Cartographers are traveling from near and far for GeoDC this month! <a href=\"http://geography.wisc.edu/cartography/\">Tanya Buckingham from University Wisconsin Madison</a> will giver her \"Top 10\" list for creating and running a cartography space!\u00a0</p> <p>Nuela Cowen from the local fan favorite - <a href=\"https://geography.columbian.gwu.edu/\">George Washington University</a> - will highlight their epic partnerships with OpenStreetMap and how their students are learning and shaping new forms of cartography.\u00a0</p> <p>More to follow - we meet the first Wednesday of every month at Local 16 on the second floor,\u00a0gathering to socialize, network, and hear about the work people are doing with maps, GIS, geodata, and more.</p> <p>As always. This promises to be a FANTASTIC evening! Plus. We'll have special trivia hints and clues that promise to give you a leg up for July's GeoDC for the first summer geo-trivia-extravaganza.\u00a0</p>", 
